import JqxLayout, { ILayoutProps } from 'jqwidgets-scripts/jqwidgets-react-tsx/jqxlayout';
import * as React from 'react';
import JqxPanel from 'jqwidgets-scripts/jqwidgets-react-tsx/jqxpanel';
import {} from '../../dvmenu'
class Users extends React.PureComponent<{}, ILayoutProps> {
    constructor(props: {}) {
        super(props);
        this.state = {
            layout: [{
                items: [{
                    alignment: 'left',
                    items: [{
                        contentContainer: 'SolutionExplorerPanel',
                        title: 'Solution Explorer',
                        type: 'layoutPanel'
                    }, {
                        contentContainer: 'PropertiesPanel',
                        title: 'Properties',
                        type: 'layoutPanel'
                    }],
                    type: 'autoHideGroup',
                    unpinnedWidth: '8%',
                    width: '8%',
                },{
                    items: [{
                        height: '95%',
                        items: [{
                            contentContainer: 'Document1Panel',
                            title: 'Document 1',
                            type: 'documentPanel'
                        }],
                        minHeight: '25%',
                        type: 'documentGroup'
                    }, {
                        height: '5%',
                        alignment:'bottom',
                        items: [{
                            contentContainer: 'ErrorListPanel',
                            title: 'Error List',
                            type: 'layoutPanel'
                        }, {
                            contentContainer: 'OutputPanel',
                            title: 'Output',
                            type: 'layoutPanel'
                        }],
                        pinnedHeight: '4%',
                        type: 'autoHideGroup',

                    }],
                    orientation: 'vertical',
                    type: 'layoutGroup',
                    width: '92%'
                }, ],
                orientation: 'horizontal',
                type: 'layoutGroup'
            }]
        }
    }
    public render() {
        return (
            <div>
            <JqxLayout style={{border: 'none'}} theme="material" width={'100%'} height={'750px'}  contextMenu={true} layout={this.state.layout}>
                <div data-container="Document1Panel">Document 1 content</div>
                <div data-container="ErrorListPanel">List of errors</div>
                <div data-container="OutputPanel">Output</div>
                <div data-container="SolutionExplorerPanel">Solution structure</div>
                <div data-container="PropertiesPanel">List of properties</div>
            </JqxLayout>
            </div>
        );
    }
}
export default Users;
